def is_one_edit_distance(s1: str, s2: str) -> bool:
    len1, len2 = len(s1), len(s2)

    if abs(len1-len2) > 1:
        return False

    i, j, count = 0, 0, 0

    while i < len1 and j < len2:
        if s1[i] != s2[j]:
            if count == 1:
                return False
            if len1 > len2:
                i += 1
            elif len1 < len2:
                j += 1
            else:
                i += 1
                j += 1
            count += 1
        else:
            i += 1
            j += 1

    if i < len1 or j < len2:
        count += 1
    return count == 1
